import React, { Component } from 'react';
import { Navbar, AddList } from '../../components';

export default class Test extends Component {
  constructor(props) {
    super(props);
    this.handleDelete = this.handleDelete.bind(this);
    this.state = {};
  }

  handleDelete(deleteName) {
    console.log(deleteName)
    const { prodAdds } = this.props;
    this.setState({
      prodAdds: prodAdds.filter(({ name }) => (deleteName !== name)),
    });
  }

  render() {
    const { prodAdds } = this.props;
    return (
      <>
        <Navbar />
        <AddList handleDelete={this.handleDelete} prodAdds={prodAdds} />
      </>
    );
  }
}
